import React from 'react'
import {Box,User,Form} from './Hero.Elements'; 
import TextField from '@material-ui/core/TextField';
import { FauUserAlt } from "react-icons/fa";
import InputAdornment from '@material-ui/core/InputAdornment';





function Hero() {
    return (
        <>
          <Box>
                <User>
                User Login
                </User>
                <Form>
                <TextField
                fullWidth
        id="input-with-icon-textfield"
        placeholder="UserName"
        label=""
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
                <FauUserAlt/>
            </InputAdornment>
          ),
        }}
      />
             
                </Form>
           </Box>
        </>
    )
}
export default Hero;
